import { Avatar, Card } from "antd";

const UserProfile = () => {
    return (
        <>
            <Card
                actions={[
                    <div key="twit">짹짹 <br />0</div>,
                    <div key="followings">짹짹 <br />0</div>,
                    <div key="followers">짹짹 <br />0</div>
                ]}
            >
                <Card.Meta
                    avatar={<Avatar>CW</Avatar>}
                    title="changwoo"
                />
            </Card>
        </>
    )
}

export default UserProfile;
